    <h2 {...{
      "id": "batch"
    }}>{`Batch`}</h2>
    <p>{`"Batch" refers to a `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}>{`batched payload`}</a>{` within a sink. It is a batch of events encoded into a payload that the downstream service understands.`}</p>
    <h2 {...{
      "id": "benchmark"
    }}>{`Benchmark`}</h2>
    <p>{`"Benchmark" refers to a test designed to measure performance and resource usage. You can learn more about Vector's benchmarks in the `}<a parentName="p" {...{
        "href": "/#performance"
      }}>{`Benchmarks`}</a>{` section.`}</p>
    <h2 {...{
      "id": "binary"
    }}>{`Binary`}</h2>
    <p>{`"Binary" refers to the static binary that Vector compiles to.`}</p>
    <h2 {...{
      "id": "buffer"
    }}>{`Buffer`}</h2>
    <p>{`"Buffer" refers to an ordered queue of events that is coupled with a sink.`}</p>
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <p>{`"Configuration" refers to the settings and options used to control Vector's behavior. You can learn more about Vector's configuration in the `}<a parentName="p" {...{
        "href": "/docs/setup/configuration/"
      }}>{`Configuration`}</a>{` section.`}</p>
    <h2 {...{
      "id": "durability"
    }}>{`Durability`}</h2>
    <p>{`"Durability" refers to the ability to retain data across exceptional events. In the context of Vector, this typically refers to the ability to retain data across restarts.`}</p>
    <h2 {...{
      "id": "event"
    }}>{`Event`}</h2>
    <p>{`"Event" refers to a single unit of data that flows through Vector. You can learn more about events in the `}<a parentName="p" {...{
        "href": "/docs/about/data-model/"
      }}>{`Data Model`}</a>{` section.`}</p>
    <h2 {...{
      "id": "filter"
    }}>{`Filter`}</h2>
    <p>{`"Filter" refers to a type of `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/"
      }}>{`transform`}</a>{` that filters events or fields on an event.`}</p>
    <h2 {...{
      "id": "flush"
    }}>{`Flush`}</h2>
    <p>{`"flush" refers to the act of sending a batched payload to a downstream service. It is a common term used in conjunction with "buffer".`}</p>
    <h2 {...{
      "id": "github"
    }}>{`Github`}</h2>
    <p>{`"`}<a parentName="p" {...{
        "href": "https://github.com/"
      }}>{`Github`}</a>{`"" refers to the service used to host Vector's source code.`}</p>
    <h2 {...{
      "id": "guide"
    }}>{`Guide`}</h2>
    <p>{`"Guide" is a tutorial or walk through on a specific subject. You can see Vector's guides in the `}<a parentName="p" {...{
        "href": "/guides"
      }}>{`Guides`}</a>{` section.`}</p>
    <h2 {...{
      "id": "log"
    }}>{`Log`}</h2>
    <p>{`"Log" refers to an individual log event. This is a type of
`}<a parentName="p" {...{
        "href": "/docs/about/data-model/metric/"
      }}>{`Vector event`}</a>{`.`}</p>
    <h2 {...{
      "id": "lucio"
    }}>{`Lucio`}</h2>
    <p>{`A sporty Italian that bleeds Rust, is a core member of the Vector team, and does not approve of New York pizza.`}</p>
    <h2 {...{
      "id": "metric"
    }}>{`Metric`}</h2>
    <p>{`"Metric" refers to an individual data unit used to represent a point in time
measurement. This is a type of `}<a parentName="p" {...{
        "href": "/docs/about/data-model/metric/"
      }}>{`Vector event`}</a>{`.`}</p>
    <h2 {...{
      "id": "parser"
    }}>{`Parser`}</h2>
    <p>{`"Parser" refers to a `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/"
      }}>{`transform`}</a>{` that parses event data.`}</p>
    <h2 {...{
      "id": "pipeline"
    }}>{`Pipeline`}</h2>
    <p>{`"Pipeline" refers to the end result from combining `}<a parentName="p" {...{
        "href": "/docs/reference/sources/"
      }}>{`sources`}</a>{`,
`}<a parentName="p" {...{
        "href": "/docs/reference/transforms/"
      }}>{`transforms`}</a>{`, and `}<a parentName="p" {...{
        "href": "/docs/reference/sinks/"
      }}>{`sinks`}</a>{`.`}</p>
    <h2 {...{
      "id": "reducer"
    }}>{`Reducer`}</h2>
    <p>{`"Reducer" refers to a `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/"
      }}>{`transform`}</a>{` that reduces data into
a metric.`}</p>
    <h2 {...{
      "id": "repo"
    }}>{`Repo`}</h2>
    <p>{`"Repo" refers to a Git respository, usually the
`}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector"
      }}>{`Vector Git repository`}</a>{`.`}</p>
    <h2 {...{
      "id": "router"
    }}>{`Router`}</h2>
    <p>{`"Router" refers is something that accepts and routes data to many destinations,
this is commonly used to describe Vector.`}</p>
    <h2 {...{
      "id": "rust"
    }}>{`Rust`}</h2>
    <p>{`"Rust" refers to the `}<a parentName="p" {...{
        "href": "https://www.rust-lang.org/"
      }}>{`Rust programming language`}</a>{` that Vector is
written in.`}</p>
    <h2 {...{
      "id": "sampler"
    }}>{`Sampler`}</h2>
    <p>{`"Sampler" refers to a `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/"
      }}>{`transform`}</a>{` that samples data.`}</p>
    <h2 {...{
      "id": "sink"
    }}>{`Sink`}</h2>
    <p>{`"Sink" refers to the Vector `}<a parentName="p" {...{
        "href": "/docs/reference/sinks/"
      }}>{`sink concept`}</a>{`.`}</p>
    <h2 {...{
      "id": "source"
    }}>{`Source`}</h2>
    <p>{`"Source" refers to the Vector `}<a parentName="p" {...{
        "href": "/docs/reference/sources/"
      }}>{`source concept`}</a>{`.`}</p>
    <h2 {...{
      "id": "strategy"
    }}>{`Strategy`}</h2>
    <p>{`"Strategy" refers to a `}<a parentName="p" {...{
        "href": "/docs/setup/deployment/strategies/"
      }}>{`deployment strategy`}</a>{` that Vector is
deployed under.`}</p>
    <h2 {...{
      "id": "structured-log"
    }}>{`Structured Log`}</h2>
    <p>{`"Structured log" refers to a log represented in a structured form, such as
a map. This is different from a text log which is represented as a single
text string.`}</p>
    <h2 {...{
      "id": "table"
    }}>{`Table`}</h2>
    <p>{`"Table" refers to the `}<a parentName="p" {...{
        "href": "https://github.com/toml-lang/toml#table"
      }}>{`TOML table type`}</a>{`.`}</p>
    <h2 {...{
      "id": "toml"
    }}>{`TOML`}</h2>
    <p>{`"TOML" refers to `}<a parentName="p" {...{
        "href": "https://github.com/toml-lang/toml"
      }}>{`Tom's Obvious Markup Language`}</a>{` and it is the syntax
used to represent the Vector configuration.`}</p>
    <h2 {...{
      "id": "topology"
    }}>{`Topology`}</h2>
    <p>{`"Topology" refers to a `}<a parentName="p" {...{
        "href": "/docs/setup/deployment/topologies/"
      }}>{`deploy topology`}</a>{` that Vector is
deployed under.`}</p>
    <h2 {...{
      "id": "transform"
    }}>{`Transform`}</h2>
    <p>{`"Transform" refers to the Vector `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/"
      }}>{`transform concept`}</a>{`.`}</p>
    <h2 {...{
      "id": "use-case"
    }}>{`Use Case`}</h2>
    <p>{`"Use case" refers to a way in which Vector is used, such logs, metrics,
reducing cost, etc.`}</p>
    <h2 {...{
      "id": "vector"
    }}>{`Vector`}</h2>
    <p>{`"Vector" is the name of this project.`}</p>
    </MDXLayout>;
}

